import React from 'react';
import { Grid } from 'semantic-ui-react';

export const Links = () => {
  return (
    <Grid.Row>
      <Segment basic>
        <Icon name='twitter' size='large'></Icon>
      </Segment>
    </Grid.Row>
  );
};
